// AIServiceHandler is an implementation of the memos.api.v1.AIService service.
type AIServiceHandler interface {
	// SemanticSearch performs semantic search on memos.
	SemanticSearch(context.Context, *connect.Request[v1.SemanticSearchRequest]) (*connect.Response[v1.SemanticSearchResponse], error)
	// SuggestTags suggests tags for memo content.
	SuggestTags(context.Context, *connect.Request[v1.SuggestTagsRequest]) (*connect.Response[v1.SuggestTagsResponse], error)
	// Chat streams a chat response with AI agents.
	Chat(context.Context, *connect.Request[v1.ChatRequest], *connect.ServerStream[v1.ChatResponse]) error
	// GetRelatedMemos finds memos related to a specific memo.
	GetRelatedMemos(context.Context, *connect.Request[v1.GetRelatedMemosRequest]) (*connect.Response[v1.GetRelatedMemosResponse], error)
	// GetParrotSelfCognition returns the metacognitive information of a parrot agent.
	GetParrotSelfCognition(context.Context, *connect.Request[v1.GetParrotSelfCognitionRequest]) (*connect.Response[v1.GetParrotSelfCognitionResponse], error)
	// ListParrots returns all available parrot agents with their metacognitive information.
	ListParrots(context.Context, *connect.Request[v1.ListParrotsRequest]) (*connect.Response[v1.ListParrotsResponse], error)
	// DetectDuplicates checks for duplicate or related memos.
	DetectDuplicates(context.Context, *connect.Request[v1.DetectDuplicatesRequest]) (*connect.Response[v1.DetectDuplicatesResponse], error)
	// MergeMemos merges source memo into target memo.
	MergeMemos(context.Context, *connect.Request[v1.MergeMemosRequest]) (*connect.Response[v1.MergeMemosResponse], error)
	// LinkMemos creates a bidirectional relation between two memos.
	LinkMemos(context.Context, *connect.Request[v1.LinkMemosRequest]) (*connect.Response[v1.LinkMemosResponse], error)
	// GetKnowledgeGraph returns the knowledge graph for the current user.
	GetKnowledgeGraph(context.Context, *connect.Request[v1.GetKnowledgeGraphRequest]) (*connect.Response[v1.GetKnowledgeGraphResponse], error)
	// GetDueReviews returns memos that are due for review.
	GetDueReviews(context.Context, *connect.Request[v1.GetDueReviewsRequest]) (*connect.Response[v1.GetDueReviewsResponse], error)
	// RecordReview records a review result and updates spaced repetition state.
	RecordReview(context.Context, *connect.Request[v1.RecordReviewRequest]) (*connect.Response[emptypb.Empty], error)
	// GetReviewStats returns review statistics for the current user.
	GetReviewStats(context.Context, *connect.Request[v1.GetReviewStatsRequest]) (*connect.Response[v1.GetReviewStatsResponse], error)
	// ListAIConversations returns a list of AI conversations.
	ListAIConversations(context.Context, *connect.Request[v1.ListAIConversationsRequest]) (*connect.Response[v1.ListAIConversationsResponse], error)
	// GetAIConversation returns a specific AI conversation with its messages.
	GetAIConversation(context.Context, *connect.Request[v1.GetAIConversationRequest]) (*connect.Response[v1.AIConversation], error)
	// CreateAIConversation creates a new AI conversation.
	CreateAIConversation(context.Context, *connect.Request[v1.CreateAIConversationRequest]) (*connect.Response[v1.AIConversation], error)
	// UpdateAIConversation updates an AI conversation.
	UpdateAIConversation(context.Context, *connect.Request[v1.UpdateAIConversationRequest]) (*connect.Response[v1.AIConversation], error)
	// GenerateConversationTitle generates a meaningful title for a conversation using AI.
	GenerateConversationTitle(context.Context, *connect.Request[v1.GenerateConversationTitleRequest]) (*connect.Response[v1.GenerateConversationTitleResponse], error)
	// DeleteAIConversation deletes an AI conversation.
	DeleteAIConversation(context.Context, *connect.Request[v1.DeleteAIConversationRequest]) (*connect.Response[emptypb.Empty], error)
	// AddContextSeparator adds a context separator marker to a conversation.
	AddContextSeparator(context.Context, *connect.Request[v1.AddContextSeparatorRequest]) (*connect.Response[emptypb.Empty], error)
	// ClearConversationMessages deletes all messages in a conversation.
	ClearConversationMessages(context.Context, *connect.Request[v1.ClearConversationMessagesRequest]) (*connect.Response[emptypb.Empty], error)
	// StopChat cancels an ongoing chat stream and terminates the associated session.
	StopChat(context.Context, *connect.Request[v1.StopChatRequest]) (*connect.Response[emptypb.Empty], error)
	// GetSessionStats retrieves statistics for a specific session.
	GetSessionStats(context.Context, *connect.Request[v1.GetSessionStatsRequest]) (*connect.Response[v1.SessionStats], error)
	// ListSessionStats retrieves session statistics with pagination.
	ListSessionStats(context.Context, *connect.Request[v1.ListSessionStatsRequest]) (*connect.Response[v1.ListSessionStatsResponse], error)
	// GetCostStats retrieves aggregated cost statistics for the user.
	GetCostStats(context.Context, *connect.Request[v1.GetCostStatsRequest]) (*connect.Response[v1.CostStats], error)
	// GetUserCostSettings retrieves user-specific cost control settings.
	GetUserCostSettings(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.UserCostSettings], error)
	// SetUserCostSettings updates user-specific cost control settings.
	SetUserCostSettings(context.Context, *connect.Request[v1.SetUserCostSettingsRequest]) (*connect.Response[v1.UserCostSettings], error)
	// ListBlocks retrieves blocks for a conversation.
	ListBlocks(context.Context, *connect.Request[v1.ListBlocksRequest]) (*connect.Response[v1.ListBlocksResponse], error)
	// GetBlock retrieves a specific block.
	GetBlock(context.Context, *connect.Request[v1.GetBlockRequest]) (*connect.Response[v1.Block], error)
	// CreateBlock creates a new conversation block.
	CreateBlock(context.Context, *connect.Request[v1.CreateBlockRequest]) (*connect.Response[v1.Block], error)
	// UpdateBlock updates a block.
	UpdateBlock(context.Context, *connect.Request[v1.UpdateBlockRequest]) (*connect.Response[v1.Block], error)
	// DeleteBlock deletes a block.
	DeleteBlock(context.Context, *connect.Request[v1.DeleteBlockRequest]) (*connect.Response[emptypb.Empty], error)
	// AppendUserInput appends a user input to an existing block.
	AppendUserInput(context.Context, *connect.Request[v1.AppendUserInputRequest]) (*connect.Response[emptypb.Empty], error)
	// AppendEvent appends an event to the block's event stream.
	AppendEvent(context.Context, *connect.Request[v1.AppendEventRequest]) (*connect.Response[emptypb.Empty], error)
	// ForkBlock creates a new block as a branch from an existing block.
	// The new block inherits the parent's conversation and user inputs,
	// allowing the user to regenerate a different AI response.
	ForkBlock(context.Context, *connect.Request[v1.ForkBlockRequest]) (*connect.Response[v1.Block], error)
	// ListBlockBranches lists all child blocks of a given block.
	// Returns the tree structure showing all branches from this block.
	ListBlockBranches(context.Context, *connect.Request[v1.ListBlockBranchesRequest]) (*connect.Response[v1.ListBlockBranchesResponse], error)
	// SwitchBranch switches the active branch for a conversation.
	// Updates the branch_path to make the specified block the active leaf.
	SwitchBranch(context.Context, *connect.Request[v1.SwitchBranchRequest]) (*connect.Response[emptypb.Empty], error)
	// DeleteBranch deletes a block and all its descendants.
	// Used for pruning unwanted conversation branches.
	DeleteBranch(context.Context, *connect.Request[v1.DeleteBranchRequest]) (*connect.Response[emptypb.Empty], error)
}

